class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        # Two pointers approach
        i = 0  # pointer for s
        j = 0  # pointer for t

        # Traverse through both strings
        while i < len(s) and j < len(t):
            if s[i] == t[j]:
                i += 1  # move to next character in s
            j += 1  # always move to next character in t

        # If we've matched all characters in s, it's a subsequence
        return i == len(s)

# Alternative one-liner solution using iteration
class SolutionAlternative:
    def isSubsequence(self, s: str, t: str) -> bool:
        it = iter(t)
        return all(c in it for c in s)

# For the follow-up question: optimized solution for multiple queries
class SolutionOptimized:
    def __init__(self, t: str):
        # Preprocess t to create a mapping of char -> list of indices
        from collections import defaultdict
        self.char_indices = defaultdict(list)
        for i, char in enumerate(t):
            self.char_indices[char].append(i)

    def isSubsequence(self, s: str) -> bool:
        import bisect
        prev_index = -1

        for char in s:
            if char not in self.char_indices:
                return False

            # Find the first occurrence of char after prev_index
            indices = self.char_indices[char]
            pos = bisect.bisect_right(indices, prev_index)

            if pos == len(indices):
                return False

            prev_index = indices[pos]

        return True
